import { makeStyles } from '@material-ui/core/styles';
import { homepagedata } from './HomePageData.js'


import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';

const useStyles = makeStyles((theme) => ({
  gridList: {
    height: 750,
    width: 1000
  },
  text:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    fontFamily: "serif",
    textAlign: "center",
    float: "left"
  },
  root:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100,
    paddingTop: 200,
    width: "100%",
    backgroundColor: "#e8f1f5",
  },
  blue:{
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-around',
    overflow: 'hidden',
    paddingBottom: 100,
    paddingTop: 200,
    backgroundColor: "red"
  }
}));
export default function Pictures(props) {
  const classes = useStyles();

    return(
      <div className={classes.root}>
        <div>
        </div>
        <div className={classes.text}>
        <h1>Hello and welcome to my portfolio! A congregation of my experiences and thoughts.</h1>
        </div>
      </div>
    )
}
